///   8.3<br /> Example: Europe, Paris TZ=CET-1CEST,M3.5.0/2,M10.5.0/3<br /> CET = designation for
///   standard time when daylight saving is not in force<br /> -1 = offset in hours = negative so
///   1 hour east of Greenwich meridian<br /> CEST = designation when daylight saving is in force
///   ("Central European Summer Time")<br /> , = no offset number between code and comma, so
///   default to one hour ahead for daylight saving<br /> M3.5.0 = when daylight saving starts =
///   the last Sunday in March (the "5th" week means the last in the month)<br /> /2, = the local
///   time when the switch occurs = 2 a.m. in this case<br /> M10.5.0 = when daylight saving ends
